package Session3;

public class SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		switch (a) {
		case 0:
			break;
		case 1:
			break;
		case 2:
			break;
		case 10:
			System.out.println("Result is " + a);
			break;
		default:
			System.out.println("This is default section");
		}
	}

}
